export default function Table({ getYearlyData }) {
  if (getYearlyData.length < 0) return;

  if (getYearlyData.length > 0) {
    return (
      <table className="result">
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
          {getYearlyData.map((data) => (
            <tr>
              <td>YEAR NUMBER</td>
              <td>TOTAL SAVINGS END OF YEAR</td>
              <td>INTEREST GAINED IN YEAR</td>
              <td>TOTAL INTEREST GAINED</td>
              <td>TOTAL INVESTED CAPITAL</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}
